import { useSearchParams, useNavigate } from 'react-router-dom';

export const JoinPage = () => {
  const [searchParams] = useSearchParams();
  const id = searchParams.get('id');
  const navigate = useNavigate();

  const handleComplete = () => {
    // 신청 완료 로직 수행 후 HabitPage로 돌아가면서 "신청 완료" 상태 전달
    navigate(`/habit/?completedId=${id}`);
  };

  return (
    <div className='App'>
      <h1>챌린지 신청 페이지</h1>
      <p>여기서 챌린지 신청 정보를 입력하고, 완료 버튼을 누르세요.</p>
      <button onClick={handleComplete}>신청 완료</button>
    </div>
  );
};
